measurements.description:
Four flowers and four buds on two inflorescences; 
	dorsal sepal chartreuse, veined darker chartreuse, mid-line dark rose, green proximally;
	synsepal chartreuse, fine veins rose;
	petals glowing chartreuse, spotted dark maroon proximally, suffused dark rose distal two-thirds;
	pouch rose, dark rose proximally; 
	staminode cream, dark green centrally; substance good, pouch heavy; texture matte, pouch glossy.
